a061d9dbefece2ef49ce726b8725c34c:
query QueryRenderersInquiryQuery(
  $artworkID: String!
) {
  artwork(id: $artworkID) {
    ...Inquiry_artwork
    __id
  }
}

fragment Inquiry_artwork on Artwork {
  _id
  id
  contact_message
  partner {
    name
    __id
  }
  ...ArtworkPreview_artwork
  __id
}

fragment ArtworkPreview_artwork on Artwork {
  id
  _id
  title
  artist_names
  date
  image {
    url
  }
  __id
}
